// App.js
import './App.css';
import Navbar from './components/Navbar';
import { BrowserRouter as Router, Routes, Route, Navigate } from "react-router-dom";
import { useEffect, useState } from "react";
import Pull from './pages/pull';
import Home from './pages/home';
import Show from './pages/show';
import Login from './pages/login';
import ShowST from './pages/showst';
import ShowLD from './pages/showld';
import PullST from './pages/pullst';
import PullLD from './pages/pullld';
import ShowDis from './pages/showdis';
import PullSuc from './pages/pullsuccess';

const PrivateRoute = ({ element }) => {
  const token = localStorage.getItem("token");
  return token ? element : <Navigate to="/" replace />;
};

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  useEffect(() => {
    const token = localStorage.getItem("token");
    setIsAuthenticated(!!token);
  }, []);

  return (
    <div className="Container">
      <Router>
        <Routes>
          <Route path="/" element={<Login />} />
          {isAuthenticated ? (
            <>
              <Navbar />
              <>
                <Route path="/home" element={<PrivateRoute element={<Home />} />} />
                <Route path="/pull" element={<PrivateRoute element={<Pull />} />} />
                <Route path="/show" element={<PrivateRoute element={<Show />} />} />
                <Route path="/showst" element={<PrivateRoute element={<ShowST />} />} />
                <Route path="/showld" element={<PrivateRoute element={<ShowLD />} />} />
                <Route path="/pullst" element={<PrivateRoute element={<PullST />} />} />
                <Route path="/pullld" element={<PrivateRoute element={<PullLD />} />} />
                <Route path="/showdis" element={<PrivateRoute element={<ShowDis />} />} />
                <Route path="/pullsuccess" element={<PrivateRoute element={<PullSuc />} />} />
              </>
            </>
          ) : (
            <Route path="*" element={<Navigate to="/" replace />} />
          )}
        </Routes>
      </Router>
    </div>
  );
}

export default App;
